import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../../notes";
function createNote (noteTerm) {
   return(
    <Note 
    key={noteTerm.id}
    title={noteTerm}
    />
   )
}


function App() {
  return (
    <div>
      <Header />
     {notes.map(createNote)}
      <Footer />
    </div>
  );
}

export default App;



